function calc_nr_persoane_intretinere (empl) {
  var count = 0; 
  for( var i=0, l=empl.contacts.size(); i<l; i++ ) {
    if ( empl.contacts.get(i).isDependendent) {
      count++;
    }
  }
  return count;
}
calc_nr_persoane_intretinere (_employee)

function calc_deduceri_angajat( venit, pers) {
  if (venit > 3000) {
    return 0;
  }
  var k = (pers<=4)?pers:4;
  if(venit<=1000) {
    return 250 + k*100;
  } else {
    return (250 + k*100) * [1-(venit-1000)/2000]
  }
}
calc_deduceri_angajat(salariu_brut, persoane_intretinere)

function baza_calcul ( v,d ){
  var b = v-d;
  return ( b>0 )? b : 0; 
}

baza_calcul ( salariu_net , deducere_tot )
